import React, { Component } from 'react'
import {FormControl} from 'react-bootstrap'

export class Home extends Component {
  render() {
    return (
      <div>
        <h1>Landing Page</h1>
        <Form.Control size="lg" type="text" placeholder="Large text" />
        <br />
      </div>
    )
  }
}

export default Home
